import React from 'react'

import './LinerProsentage.scss'



const LineerProsentage = ({prosentage = 80}) => {
    let num = Math.floor(prosentage/10)
    var ovals = []
    for(let i = 0; i < num; i++){
        ovals.push(<div key={i} className="oval-fill"/>)
    }

    if(!(ovals.length===10)){
        for(let j = 0; j < 10-ovals.length; j++){
            ovals.push(<div key={j} className="oval"/>)
        }
    }

    return (
        <div className="d-flr"></div>
    )

}

export default LineerProsentage
